async function fulfillOrders(data)
{
    let account = await getAccount()
    let signedMaker =  JSON.parse(data.signed_maker_data)
    await nftswaper.fillOrder(account, data.client_nft_address, data.client_nft_token_id, signedMaker)
    removeAnyPopup("div", "class", "ApprovingModal_overlay__w7Ge3 lg:flex lg:justify-center lg:items-center lg:fixed lg:top-0 lg:left-0 lg:w-full lg:h-full z-[20000]" )
    await apiQuery(`/api/trades/${data.id}`, {status: "True"}, true, "PUT")
}

